import firstDog from "./img-react/dog-1.jpeg";
import secondDog from "./img-react/dog-2.jpeg";
import thirdDog from "./img-react/dog-3.jpeg";
function Card(props) {
  return (
    <div className=" box">
      <img src={props.imageURL} height="300px" width="290px" />
      <h6 className="blog-dates">{props.date}</h6>
      <h4 className="blog-headings">{props.bHeading}</h4>
      <button className="blog-btn">Read more</button>
    </div>
  );
}
function App() {
  return (
    <div className="">
      <Card
        imageURL={firstDog}
        date="24 jan 2024"
        bHeading={
          <div>
            Finding your perfect <br /> dog breed
          </div>
        }
      />
      <Card
        imageURL={secondDog}
        date="23 jan 2024"
        bHeading={
          <div>
            5 signs that it's time to <br /> change your dog's diet
          </div>
        }
      />
      <Card
        imageURL={thirdDog}
        date="21 jan 2024"
        bHeading={
          <div>
            Taking care of your <br /> dog's joints
          </div>
        }
      />{" "}
    </div>
  );
}
export default App;
